import './App.css'
import { TodoCounter } from '../components/TodoCounter'
import {TodoSearch } from '../components/TodoSearch'
function App() {
  return (
    <div className="App">
      <TodoCounter/>
      <TodoSearch/>
      <TodoList>
        <TodoItem/>
        <TodoItem/>
        <TodoItem/>
      </TodoList>
      <CreateTodoButton/>
    </div>
  )
}

function TodoItem(){
  return (
    <li>
      <span>V</span>
      <p>Clean code</p>
      <span>X</span>
    </li>
  )
}

export default App;
